function App() {
  function checkKey(e) {
    if (e.keyCode === 38) {
      setSlide(slide - 1);
    } else if (e.keyCode === 40) {
      setSlide(slide + 1);
    }
  }
  return (
    <div className="App" onKeyDown={(e) => checkKey(e)}>
      <Burger slide={slide} />
      <Main />
